bacon for dinner 🙌🏼
you guys, my house smells glorious. not to mention the roasted chicken I'm roasting in the oven covered in bacon fat 👌🏼😎 yep, I roll like that.
@buyranchdirect thank you for the best high-quality meat! I'm obsessed 😍

go green or go home 🌱🌿🍃
I drink my @lovesuja with a meal or snack.. sometimes both 😏
@perfectbar AB bar is just perfect 😻

🎶 whip it real hard, whip it, whip it real hard 🎶
that's what i did see 👀🤤elliott and i are gonna be plopped on the couch eating this before we head out to the park!
@bilinskisausage wild mushroom sausage, @iloveorganicgirl baby spinach drizzled with @chosenfoods avo oil, pink salt, cayenne + black pepper, sunflower sprouts, 1/2 avo, steamed brussels, sautéed mushrooms and @waybettersnacks chips. YES. go 'head 😎🙌🏼

this right here.. is a dime piece 🤤
@erewhonmarket paleo toast, @siggisdairy vanilla yogurt, organic figs + strawberries, crunchy pb, pink salt, cinnamon and melted @fourthandheart vanilla bean ghee. yep.
HAPPY MONDAY!

@rebbl 's golden milk and bowl of goods vibin so hard right now.
i mean, just take a look 👀🤳🏼👅 GOODNESS! gimme allllll the turmeric to help kick this slight cold i've got 🤧☺️
do it.. cinnamon roasted butternut squash (roast at 375 for about 45min with @fourthandheart vanilla bean ghee, pink sea salt and cinnamon), @purely_elizabeth grain free granola, organic honeydew, @siggisdairy vanilla yogurt, @wedderspoonofficial manuka honey, @solsticecanyon aztec chocolate ab with a side of a damn good drank! ☝🏼

STKU//NYC LIT GUIDE💥🗽
i received TONS of messages asking to do a nyc post of the places i visited last week.. well, here it is! i tend to google the eff outta my visits to ensure i’m hitting up the “cool” and tastiest spots. i’m not gonna lie, i do a pretty good job at that. hope you guys love some of these spots 🙏🏼💃🏻
breakfast/lunch spots:
@bluestonelanecoffee turmeric latte was lit and i’m still dreaming of their roasted sweet potato hummus toast.
@sundayinbrooklyn the house made potatoes are the best taters i’ve ever had and smoked salmon was on point!
@cocolovescru such good aussie breakfast spot 😍 simple breakfast dishes done right. do yourself a favor and order the bacon.
@demarianyc creative and vibrant food in an awesome part of town!
dinner:
@diginn love this spot. can’t go wrong with making a bowl to your liking with seasonal goods🤗
@inday_nyc delicious indian bowls made with real food! it’s so flavorful 🤤 aj calls it “indian chipotle”
@springbone bone broth is always a must here!
@psp_nyc don’t be scared. the gluten here is LEGENDARY and worth every bite. order a pepperoni square.. or two if you’re feeling wild.
@hukitchen i usually go with the roasted chicken, sweet potatoes and cauli mash. EVERYTHING here is incredible.

almond butter dark chocolate.. IS LIFE 🙌🏼
so I made stovetop oats with it duh 🙄🍫
@purely_elizabeth oats, 1/4 @mastbrothers almond butter chocolate bar, 1/2 banana, 1tsp @farmtogold ghee and 1/2C flax milk.. simplicity at its finest ☺️

feeling the LURVVVV big time! i can't thank you enough for being so kind, supportive and responsive to my posts and stories. you're one of a kind. it's been a crazy few weeks over here with projects and elliott's birthday almost being here.. hoping after all that and the holidays, i can start being more consistent with you guys cause i love responding and being engaging. i apologize for my lack thereof 🙋🏻 i hope you all understand. i love you like crazy!
happy wednesday 💋 do dis: 3/4C @sproutedflour sprouted oats, 1Tbs @epicseed chia seeds, 1Tbs @bobsredmill flax seeds, 1 bottle of vanilla @popandbottle almond milk, @siggisdairy yogurt, organic figs, @solsticecanyon chocolate AB and @simplyorganicfoods cinnamon 🍴
